    setInput(e.target.value);
  };
  const handleSubmit = (e) => {
    console.log(e.target.value);
    setError("error")
    // if()
  };
  return (
    <div>
      <input type="text" value={input} onChange={handleChange} />
      {error}
      <button type="submit" onClick={handleSubmit}>
        Submit
      </button>
    </div>
  );
};

export default Form;
